import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Square = createReactComponent("Square", ["svg", defaultAttributes, [["rect", {
  x: "3",
  y: "3",
  width: "18",
  height: "18",
  rx: "2",
  ry: "2",
  key: "1sylwi"
}]]]);
export default Square;
